import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Button, Row, Container, FormGroup, Input, Form } from "reactstrap";

class Body extends Component {
  render() {
    return (
      <Container>
        <br></br>
        <br></br>
        <Form inline>
          <FormGroup style={{ width: "100%" }}>
            <Input name="search" id="exampleEmail" placeholder="Cari..." />
          </FormGroup>
          <Button>Cari</Button>
        </Form>
      </Container>
    );
  }
}

export default Body;
